class HomeView {
  _markup() {
    return `
    <div class="notfound">404 Not found</div>
    `;
  }

  render() {
    document
      .querySelector("#root")
      .insertAdjacentHTML("beforeend", this._markup());
  }
}

export default new HomeView();
